import {
  Box,
  Grid,
  Image,
  Menu,
  MenuButton,
  MenuItem,
  MenuList,
  Text,
} from "@chakra-ui/react";
import { Link } from "react-router-dom";
import React from "react";
import image1 from "../assets/MegaMenu/mm1.png";
import image2 from "../assets/MegaMenu/mm2.png";
import image3 from "../assets/MegaMenu/mm3.png";
import image4 from "../assets/MegaMenu/mm4.png";
import image5 from "../assets/MegaMenu/mm5.png";
import image6 from "../assets/MegaMenu/mm6.png";
const MegaMenu = () => {
  return (
    <Box w={{ base: "100%", lg: "95%" }} margin="auto">
      <Grid
        templateColumns={{
          base: "repeat(2, 1fr)",
          sm: "repeat(3, 1fr)",
          md: "repeat(4, 1fr)",
          lg: "repeat(6, 1fr)",
        }}
        gap="38px"
      >
        <Menu>
          <MenuButton>
            <Box
              display="flex"
              justifyContent="center"
              alignItems="center"
              w="130px"
            >
              <Image
                p="0px 10px 0px 15px"
                w={{ base: "45px", sm: "50px", md: "80px" }}
                src={image1}
                h="100%"
              />
              <Text fontSize={{ base: "12px", sm: "14px", md: "16px" }}>
                Building & Construction
              </Text>
            </Box>
          </MenuButton>
          <MenuList>
            <Grid
              templateColumns={{
                base: "repeat(2, 1fr)",
                md: "repeat(4, 1fr)",
                lg: "repeat(5, 1fr)",
                xl: "repeat(6, 1fr)",
              }}
              p={{
                base: "0px",
                lg: "0px 15px 0px 17px",
                xl: "0px 30px 0px 35px",
              }}
            >
              <Box>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontWeight="700"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Wood, Plywood,
                  <br /> Veneer & Laminates
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Plywoods{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Laminate Sheets{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Wood Boards{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Wall Panels{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Hardwood{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Particle Board{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  MDF Board{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Wooden Planks{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  WPC Board{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Wood Veneer{" "}
                </MenuItem>
              </Box>
              <Box>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontWeight="700"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Steel Bars, Rods, Plates
                  <br /> & Sheets
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  TMT Bars{" "}
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
                  p={{ base: "3px 0px 3px 5px", md: "4px 0px 4px 10px" }}
                >
                  Steel Plates
                </MenuItem>
                <MenuItem
                  fontStyle="Arial,Helvetica,sans-serif"
                  fontSize={{ base: "9px", sm: "10px", md: "12px" }}
